import React from 'react'
import {
    Dialog,
    DialogActions,
    DialogContent,
    Select,
    DialogTitle,
    IconButton,
    TextField,
    MenuItem,
    InputLabel,
    Button
} from "@material-ui/core";
import CloseIcon from '@material-ui/icons/Close';
import CircularProgress from "@material-ui/core/CircularProgress";
import { FormErrors } from "components/Login/FormErrors";
const AddProject = (props) => {
    const { openProjects, confirmModalClose, loading} = props;
    return (
        <Dialog
            className="call-modal"
            maxWidth={'sm'}
            open={openProjects}
        >
            <DialogTitle className="add-modal-title" id="discharge-planner-dialog-title">
                {title}
                <IconButton aria-label="close">
                    <CloseIcon onClick={confirmModalClose} />
                </IconButton>
            </DialogTitle>
            <DialogContent>
                <div className="dollar_modal">
                    <TextField id="standard-basic" label="Reward Amount" className="modal_desc model_width" pattern="[0-9]*" name="amount" value={amount} onChange={onChange} />
                    {(errors && errors.amount) && <FormErrors
                        show={errors.amount ? true : false}
                        formErrors={errors}
                        fieldName="amount"
                    />}
                </div>
                <div className="dollar_modal">
                    <InputLabel id="demo-simple-select-label model_width">Reward Month</InputLabel>
                    <Select
                        labelId="demo-simple-select-label"
                        id="demo-simple-select"
                        className="role_name client model_width"
                        name="month"
                        value={month}
                        onChange={onChange}
                    >
                        <MenuItem value="1"> 1 Month</MenuItem>
                        <MenuItem value="2">2 Month</MenuItem>
                        <MenuItem value="3">3 Month</MenuItem>
                        <MenuItem value="4">4 Month</MenuItem>
                        <MenuItem value="5">5 Month</MenuItem>
                    </Select>
                </div>
                {(errors && errors.month) && <FormErrors
                    show={errors.month ? true : false}
                    formErrors={errors}
                    fieldName="month"
                />}
            </DialogContent>
            <DialogActions className="modal-actions" justify="center" >
                <Button type="button" className="btn1" onClick={submit} disabled={(errors && Object.keys(errors).length > 0) ? true : false}>
                    {loading && (
                        <CircularProgress
                            size={24}
                            className="buttonProgress"
                        />
                    )}
                    Update
                </Button>
                <Button color="primary" className="btn2" onClick={confirmModalClose}>
                    Cancel
                </Button>
            </DialogActions>
        </Dialog>
    )
}

export default AddProject
